import './App.css';
import NewsPage from './paginas/news.js';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

function App() {
  return (
    <Router>

    <div className="platform">  
        <Switch>
            <Route peath="/tour/:slug" render={(matchProps) =>
                <XEngine
                    {...matchProps}
                    {...this.props}
                    handleMatch={this.handleMatch}
                />
            }>
            </Route>
            <Route path="/:slug" render={(matchProps) =>
                <PageContainer>
                    <ExperiencePage
                        {...matchProps}
                        {...this.props}
                        handleMatch={this.handleMatch}
                    />
                </PageContainer>
            }>
            </Route>
            <Route exact path="/">
                <PageContainer>
                    <Explore />
                </PageContainer>
            </Route>
            <Route path="/login">
                <PageContainer>
                    <Login />
                </PageContainer>
            </Route>
            <Route path="/register">
                <PageContainer>
                    <Register />
                </PageContainer>
            </Route>
        </Switch>
    </div>
    <div className="App">
      <header className="App-header">

          <NewsPage/>



      </header>
    </div>
    </Router>

  );
}

export default App;
